import Header from "../../components/header/Header";
import "./Engine.css";

function Engines() {
    return (
      <>
        <Header />
        <body>
          <h1>Engines</h1>

          <div class="engine-list">
            <div class="type-engine">

                <div class="turboprop">
                    <h4>Turboprop</h4>
                </div>

                <div class="turbojet">
                    <h4>Turbojet</h4>
                </div>

                <div class="turbofan">
                    <h4>Turbofan</h4>
                </div>

            </div>
          </div>
        </body>
      </>
    );
  }
  
  export default Engines;
